import * as CommonStyles from '../../styles/common-styles';
import * as Universal from '../../../universal';
import React from 'react';
import ResponsiveTextField from '../../common-comps/ResponsiveTextField';
import ResponsiveText from '../../common-comps/ResponsiveText';

const TITLE_SIZE = 36;
const TEXT_FIELD_SIZE = 28;

const EMAIL_TEXT_FIELD_WIDTH = '56%';
const OTHER_TEXT_FIELD_WIDTHS = '49%';

export default class AccountInfo extends React.Component<any, any> {
    constructor(props: any) {
        super(props);
    }

    containerStyle = () => ({
        width: '100%'
    });

    textFieldContainerStyle = () => ({
        ...CommonStyles.FlexColCStart,
        width: '100%'
    });

    passwordContainerStyle = () => ({
        ...CommonStyles.FlexCSpace,
        marginTop: '1.5%',
        width: '100%'
    });

    render = () => {
        return (
            <div>
                <div style={this.containerStyle()}>
                    <ResponsiveText size={TITLE_SIZE} padding="2.5% 0 1% 0">
                        Account Information
                    </ResponsiveText>
                    <div style={this.textFieldContainerStyle()}>
                        <ResponsiveTextField
                            placeholder="Cornell Email"
                            onChange={() => console.log('hi')}
                            size={TEXT_FIELD_SIZE}
                            width={EMAIL_TEXT_FIELD_WIDTH}
                        ></ResponsiveTextField>
                        <div style={this.passwordContainerStyle()}>
                            <ResponsiveTextField
                                placeholder="Create Password"
                                onChange={() => console.log('hi')}
                                size={TEXT_FIELD_SIZE}
                                width={OTHER_TEXT_FIELD_WIDTHS}
                            ></ResponsiveTextField>
                            <ResponsiveTextField
                                placeholder="Confirm Password"
                                onChange={() => console.log('hi')}
                                size={TEXT_FIELD_SIZE}
                                width={OTHER_TEXT_FIELD_WIDTHS}
                            ></ResponsiveTextField>
                        </div>
                    </div>
                </div>

                <div style={this.containerStyle()}>
                    <ResponsiveText size={TITLE_SIZE} padding="2.5% 0 1% 0">
                        Personal Information
                    </ResponsiveText>
                    <div style={this.textFieldContainer()}>
                        <ResponsiveTextField
                            placeholder="First Name"
                            onChange={() => console.log('hi')}
                            size={TEXT_FIELD_SIZE}
                            width={TEXT_FIELD_WIDTH}
                        ></ResponsiveTextField>
                        <ResponsiveTextField
                            placeholder="Last Name"
                            onChange={() => console.log('hi')}
                            size={TEXT_FIELD_SIZE}
                            width={TEXT_FIELD_WIDTH}
                        ></ResponsiveTextField>
                        <ResponsiveTextField
                            placeholder="Grade Level"
                            onChange={() => console.log('hi')}
                            size={TEXT_FIELD_SIZE}
                            width={TEXT_FIELD_WIDTH}
                        ></ResponsiveTextField>
                    </div>
                </div>
            </div>
        );
    };
}
